import React from 'react'
import Dashboard from './components/Dashboard'

class App extends React.Component{
    render(){
        return(
            //<h1> Belajar react batch 220</h1>
           <switch>
          < route exact path= '/' Component = {login} /> 
          <Dashboard/>
        </switch>
        )
    }
}
export default App

